textOriginal:
Causa estranhamento a atitude do TSE diante dessas denúncias:

1. 30 min. pós receber e-mail de uma rádio mineira confirmando a irregularidade nas inserções, exoneram o servidor, que é colocado na rua, literalmente;

2. Justificam a exoneração alegando que era algo planejado anteriormente;

3. Horas depois, apontam outra justificativa diversa, alegando que a exoneração ocorreu por assédio moral;

4. O pedido do Presidente é rejeitado liminarmente, sendo o caso enviado ao STF para ser tratado como caso de milícia digital, havendo risco de punição ao denunciante.
